import { React,useState } from 'react'
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import "../../CSS/Component/SignUpIn/SignUp.css"
export default function SignUp() {
  const [FlipCard,SetFlipCard]=useState(0);
  const [disabled,Setdisabled]=useState(true)
  const [data, setData] = useState({
		Username: "",
		email: "",
		password: "",
	});
	const [error, setError] = useState("");
	const navigate = useNavigate();

	const handleChange = ({ currentTarget: input }) => {
		setData({ ...data, [input.name]: input.value });
        console.log(data);
	};
function ConfirmPassword(){
    if(document.getElementById("Password")===document.getElementById("ConfirmPassword"))
    {
        Setdisabled(false)
    }
    else{
        Setdisabled(true)
    }
}
	const handleSubmit = async (e) => {
		e.preventDefault();
		try {
			const url = "http://localhost:8080/api/userRegistration";
			const { data: res } = await axios.post(url, data);
			navigate("/login");
			console.log(res.message);
		} catch (error) {
			if (
				error.response &&
				error.response.status >= 400 &&
				error.response.status <= 500
			) {
				setError(error.response.data.message);
			}
		}
	};
function Flip()
{
FlipCard===0?SetFlipCard(1):SetFlipCard(0);
}

  return (
    <>
    <div className="container-fluid SignUpContainer">
   <div className='row ms-sm-5 mt-sm-5 mb-sm-5 '>
    <div className='col-md-6'>
<img src="Images/SignUp/SignUp.png" className=' SignUpImage' alt="SignInto Your Account"/>
    </div>
    <div className='col-md-6'>
 <div className='container-fluid'>
  <div className='row'>
  <div className='Container-Sign'>
<div className={`inner-Section-Card ${FlipCard===0?"":"inner-Section-Cardflip"}`}>
{ FlipCard===0 && <div className='SignUp-Card-front '>
  <div className='container-fluid'>
    <div className='row'>
      <h1 style={{'text-align':'center'}}>SignUp</h1>
    </div>
    <div className='row'>
      <form onSubmit={handleSubmit}>
      <div className="mb-3">
  <label className="form-label">Username</label>
  <input type="text" className="form-control" placeholder="Muhammad Ali" name="Username"
							onChange={handleChange}
							value={data.Username}
							required/>
</div>
      <div className="mb-3">
  <label className="form-label">Email address</label>
  <input type="email" className="form-control" placeholder="name@example.com"
  name="email"
  onChange={handleChange}
  value={data.email}
  required/>
</div>
<div className="mb-3">
  <label className="form-label">Password</label>
  <input type="password" className="form-control" placeholder="••••••••••"
  name="password"
  onChange={handleChange}
  value={data.password}
  required
  />
</div>
<div className="mb-3">
  <label className="form-label">Confirm Password</label>
  <input type="password" className="form-control"  onChange={ConfirmPassword} placeholder="••••••••••"/>
</div>
{/* {error && <div className={styles.error_msg}>{error}</div>} */}
<div className='d-flex justify-content-between'>
<span className="SignIn-Link" onClick={()=>Flip()}>Already Have Account?</span>
<button type="button" className="btn btn-primary"
disabled={disabled}
>SignUp</button>
</div>
      </form>      
    </div>
  </div>
    </div>}
    { FlipCard===1 &&   <div className='SignIn-Card-back'>
    <div className='container-fluid'>
    <div className='row'>
      <h1 style={{'text-align':'center'}}>SigIn</h1>
    </div>
    <div className='row'>
      <form>

      <div className="mb-3">
  <label className="form-label">Email address</label>
  <input type="email" className="form-control" placeholder="name@example.com"/>
</div>
<div className="mb-3">
  <label className="form-label">Password</label>
  <input type="password" className="form-control" placeholder="••••••••••"/>
</div>
<div className='d-flex justify-content-between'>
<span className="SignIn-Link" onClick={()=>Flip()}>Did'nt Have an Account?</span>
<button type="button" className="btn btn-primary">SignIn</button>
</div>
      </form>
      
      
    </div>
  </div>
    </div>}
</div>
 </div>
  </div>
 </div>
    </div>
   </div>
    </div>
    </>
  )
}
